import { styled } from 'styled-components';

export const Container = styled.main`
    min-height: 70vh;
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
    
    form{
        display: flex;
        flex-direction: column;
        align-items: center;
        justify-content: center;
    }
`;

export const Input = styled.input`
    padding: 30px;
`;
